script: |
  super -f text -I q11516.spq | sort > q11516.out

inputs:
  - name: q11516.spq
    data: |
      SELECT DISTINCT + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 - + col0 + + - col2 * - 12 BETWEEN + 13 AND + col2 * + col0 + col1 * 94;
  - name: tab2

outputs:
  - name: q11516.out
    data: |
      46
      64
      75
